import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Login from './components/Authentication/Login';
import Register from './components/Authentication/Register';
import ForgotPassword from './components/Authentication/ForgotPassword';
import FaceCapture from './components/eKYC/FaceCapture';
import DocumentScanner from './components/eKYC/DocumentScanner';
import ClothOrderForm from './components/ClothOrder/ClothOrderForm';
import AdminDashboard from './components/Admin/AdminDashboard';

const App = () => {
  return (
    <Router>
        {/* Authentication routes */}
        <Route path="/login" component={Login} />
        <Route path="/register" component={Register} />
        <Route path="/forgot-password" component={ForgotPassword} />

        {/* eKYC routes */}
        <Route path="/face-capture" component={FaceCapture} />
        <Route path="/document-scanner" component={DocumentScanner} />

        {/* Cloth Order route */}
        <Route path="/cloth-order" component={ClothOrderForm} />

        {/* Admin route */}
        <Route path="/admin" component={AdminDashboard} />

        {/* Default route */}
        <Route path="/" component={Home} />
    </Router>
  );
};

export default App;
